import React from 'react';
import './App.css';
import LoginForm from './component/login';
import Message from './component/Message';
import Greet from './component/Greet'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Greet />
        <Message />
        <LoginForm />
      </header>
    </div>
  );
}

export default App;
